// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract UserRegistry {

    struct User {
        string name;
        string location;
        string gender;
        string phone;
        string nationalId;
    }

    mapping(address => User) private users;
    mapping(address => bool) public isRegistered;

    event UserRegistered(address indexed user, string name, string location);

    // Register a user
    function registerUser(
        string memory _name,
        string memory _location,
        string memory _gender,
        string memory _phone,
        string memory _nationalId
    ) public {
        require(!isRegistered[msg.sender], "User already registered");

        users[msg.sender] = User(_name, _location, _gender, _phone, _nationalId);
        isRegistered[msg.sender] = true;

        emit UserRegistered(msg.sender, _name, _location);
    }

    // View user details
    function getUser(address _user) public view returns (
        string memory name,
        string memory location,
        string memory gender,
        string memory phone,
        string memory nationalId
    ) {
        require(isRegistered[_user], "User not registered");

        User memory u = users[_user];
        return (u.name, u.location, u.gender, u.phone, u.nationalId);
    }
}
